const Pagination = ( { total, limit, page, setPage} ) => {
    const numPages = Math.ceil(total / limit);

    return (
        <>
            <nav>
                <button
                    onClick={() => setPage(page-1)}
                >
                    &lt;
                </button>
                {Array(numPages)
                    .fill()
                    .map((_, i) => (
                        <button
                            key={i + 1}
                            onClick={() => setPage(i + 1)}
                        >
                            {i + 1}
                        </button>
                    ))}
                <button
                    onClick={() => setPage(page+1)}
                >
                    &gt;
                </button>
            </nav>
        </>
    );
};

export default Pagination;
